# Capstone Project 1 - Credit Card Approval

# Use MySQL or PyMySQL to perform the below queries. 

use credit_card_analysis;

#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
      # Question 1 & its Answers 
#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
# 1. Group the customers based on their income type and find the average of their annual income.
					#-----------------Income Type and There Avarage Income---------------------------# 
select income_type, round(avg(income)) as avg_income from details
group by income_type;


#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
      # Question 2nd & its Answers
#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
# 2. Find the female owners of cars and property.
					#-----------------List all female owners who have cars and property---------------------------
select id as female_with_car_property from details
where gender='F' and car='Y' and property='Y';


#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
      # Question 3rd & its Answers
#--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- 
# 3. Find the male customers who are staying with their families.
					#-----------------List all male customers who are staying with their families---------------------------
select id as male_staying_with_family from details
where gender='M' and housing_type='With parents';


#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
      # Question 4th & its Answers
#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
# 4. Please list the top five people having the highest income.
					#-----------------Top five people with highest income---------------------------
with income_cte as 
(select distinct income from details order by income desc limit 5)
select id as top_5_people, income from details
where income in (select income from income_cte)
order by income desc;


#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
      # Question 5th & its Answers
#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
# 5. How many married people are having bad credit?
					#-----------------Count of Married people with bad credit---------------------------
select count(id) as married_bad_credit_count from details
where reject=1 and marital_status='Married';


#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
      # Question 6th & its Answers
#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
 # 6. What is the highest education level and what is the total count?
					#-----------------highest education level & its count---------------------------
select education, count(education) as total_count from details
where education like 'high%'
order by total_count desc;


#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
      # Question 7th & its Answers
#---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
 # 7. Between married males and females, who is having more bad credit? 
					#-----------------bad credit---------------------------
select gender, count(gender) as bad_credit_count from details
where reject=1
group by gender
order by bad_credit_count desc
limit 1;













